import React from 'react';
import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';
import Img1 from '../images/인사말1.png';

import Img2 from '../images/인사말2.jpg';

import styles from './Aboutaone.module.css';

const Aboutaone = () => {
  return (
    <div>
      <Top />
      <div className={styles.down}> 인 사 말 </div>
      <br />

      <div class="container">
        <img src={Img1} alt="인사말1" />
        <br /> <br /> <br />
        <div class="row">
          <div class="col-1"></div>
          <div class="col-2">
            {' '}
            <img src={Img2} alt="인사말1" />
          </div>
          <div class="col-6">
            {' '}
            업무영역 측면에서도 수출입 통관, 검역, FTA(Free Trade Agreement),
            AEO(Authorized Economic Operator)컨설팅, 심사 쟁송 분야까지 수행하는
            등 국내에서 가장 넓은 영역을 서비스하고 있으며, 통관 및 컨설팅 실적
            국내 1위, 행정쟁송 승소실적 1위인 명실상부 업계 최고의 기업입니다.
            <br />
            <br />
            에이원은 동종업계에서 최초로 AEO인증을 취득하고 이후 더 발전된
            모습으로 AA 인증도 취득하며 전문성을 인정받고 여러 고객사의 AEO인증
            컨설팅을 수행하고 있습니다.
          </div>
        </div>
      </div>
      <Bottom />
    </div>
  );
};

export default Aboutaone;
